import {Link, useNavigate} from "react-router-dom";
import {Formik} from "formik";
import {useDispatch, useSelector} from "react-redux";
import {addBlogs} from "../../services/blogService";

export default function AddBlog (){
    const dispatch = useDispatch()
    const navigate = useNavigate()
    const user = useSelector(state => {
        return state.user.user
    })
    const handleAdd = (values) =>{
        let data = {...values,user:{id:user.id} }
        dispatch(addBlogs(data))
    }
    return(
        <div className={'row'} >
            <div className={'col-12'}>
                <h1>Add Blogs</h1>
                <Formik initialValues={{userId:'', name:'',date:'', amount:'',type:'',tradeTypeId:'' }}
                        onSubmit={(values) =>{


                }}>
                <form>
                    <div className="offset-3 col-6">
                    <div className="form-group">
                        <label htmlFor="exampleInputEmail1">User ID</label>
                        <input type="text" className={"form-control"} name={'userId'} placeholder={'User Id'}/>

                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleInputPassword1">Name</label>
                        <input type="text" className={"form-control"} name={'name'} placeholder={'Name'}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleInputPassword1">Date</label>
                        <input type="date" className={"form-control"} name={'date'} placeholder={'Date'}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleInputPassword1">Amount</label>
                        <input type="text" className={"form-control"} name={'amount'} placeholder={'Amount'}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleInputPassword1">Type</label>
                        <input type="text" className={"form-control"} name={'type'} placeholder={'Type'}/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleInputPassword1">Trade Type</label>
                        <input type="text" className={"form-control"} name={'tradeTypeId'} placeholder={'Trade Type'}/>
                    </div>

                    <Link to={"/home"}>  <button type="submit" className="btn btn-primary">Submit</button></Link>
                    </div>

                </form>
                </Formik>
            </div>
        </div>
    )
}
